    <style>

        .leaflet-container .leaflet-control-search {
            position: relative;
            float: left;
            background: #fff;
            color: #1978cf;
            border: 2px solid rgba(0, 0, 0, 0.2);
            background-clip: padding-box;
            -moz-border-radius: 4px;
            -webkit-border-radius: 4px;
            border-radius: 4px;
            background-color: rgba(255, 255, 255, 0.8);
            z-index: 1000;
            margin-left: 10px;
            margin-top: 10px;
        }

        .leaflet-control-search.search-exp { /*expanded*/
            background: #fff;
            border: 2px solid rgba(0, 0, 0, 0.2);
            background-clip: padding-box;
        }

        .leaflet-control-search .search-input {
            display: block;
            float: left;
            background: #fff;
            border: 1px solid #666;
            border-radius: 2px;
            height: 22px;
            padding: 0 20px 0 2px;
            margin: 4px 0 4px 4px;
        }

        .leaflet-control-search.search-load .search-input {
            background: url('/upload/loader.gif') no-repeat center right #fff;
        }

        .leaflet-control-search.search-load .search-cancel {
            visibility: hidden;
        }

        .leaflet-control-search .search-cancel {
            display: block;
            width: 22px;
            height: 22px;
            position: absolute;
            right: 28px;
            margin: 6px 0;
            background: url('/upload/search-icon.png') no-repeat 0 -46px;
            text-decoration: none;
            filter: alpha(opacity=80);
            opacity: 0.8;
        }

        .leaflet-control-search .search-cancel:hover {
            filter: alpha(opacity=100);
            opacity: 1;
        }

        .leaflet-control-search .search-cancel span {
            display: none; /* comment for cancel button imageless */
            font-size: 18px;
            line-height: 20px;
            color: #ccc;
            font-weight: bold;
        }

        .leaflet-control-search .search-cancel:hover span {
            color: #aaa;
        }

        .leaflet-control-search .search-button {
            display: block;
            float: left;
            width: 30px;
            height: 30px;
            background: url('/upload/search-icon.png') no-repeat 4px 4px #fff;
            border-radius: 4px;
        }

        .leaflet-control-search .search-button:hover {
            background: url('/upload/search-icon.png') no-repeat 4px -20px #fafafa;
        }

        .leaflet-control-search .search-tooltip {
            position: absolute;
            top: 100%;
            left: 0;
            float: left;
            list-style: none;
            padding-left: 0;
            min-width: 120px;
            max-height: 122px;
            box-shadow: 1px 1px 6px rgba(0, 0, 0, 0.4);
            background-color: rgba(0, 0, 0, 0.25);
            z-index: 1010;
            overflow-y: auto;
            overflow-x: hidden;
            cursor: pointer;
            margin-top: 2px;
        }

        .leaflet-control-search .search-tip {
            margin: 2px;
            padding: 2px 4px;
            display: block;
            /*color:black;*/
            background: #eee;
            border-radius: .25em;
            text-decoration: none;
            white-space: nowrap;
            vertical-align: center;
        }

        .leaflet-control-search .search-button:hover {
            background-color: #f4f4f4;
        }

        .leaflet-control-search .search-tip-select,
        .leaflet-control-search .search-tip:hover {
            background-color: #fff;
        }

        .leaflet-control-search .search-alert {
            cursor: pointer;
            clear: both;
            font-size: .75em;
            margin-bottom: 5px;
            padding: 0 .25em;
            color: #e00;
            font-weight: bold;
            border-radius: .25em;
        }


        .leaflet-popup-content {
            height: auto;
        }

        .tab-list .selected {
            background: #e7ab3c;
            color: #fff;
        }

        .tab-list {
            display: inline-block;
            list-style: none;
            padding: 0;
            margin: 0;
        }

        .tab-header {
            display: inline-block;
            font-size: 18px;
            text-transform: uppercase;
            cursor: pointer;
            transition: .3s all;
            position: relative;
            overflow: hidden;
        }

        @media (max-width: 600px) {
            .tab-header {
                display: inline-block;
                font-size: 10px;
                width: 25%;
                text-transform: uppercase;
                cursor: pointer;
                transition: .3s all;
                position: relative;
                overflow: hidden;
            }

            .tab-list {
                display: inline-block;
                list-style: none;
                text-align: right;
                padding: 0;
                margin: 0;
            }
        }

        .tab-header:after {
            content: '';
            position: absolute;
            width: 100%;
            height: 100%;
            top: 100%;
            left: 0;
            background: firebrick;
            z-index: -1;
            border-left: .3px solid gray;
            border-right: .3px solid gray;
            transition: .2s all;
        }

        .selected {
            background: gray;
            color: white;
        }

        .selected:before {
            content: '';
            width: 65%;
            left: 17.5%;
            position: absolute;
            height: 87%;
            top: 0;
            z-index: -1;
            border-bottom: .3px solid brown;
        }

        .tab-header:hover {
            letter-spacing: 2px;
            color: white;
        }

        .tab-header:hover:after {
            top: 0;
        }

        .content-container {
            position: relative;
        }

        .tab-content {
            position: absolute;
            top: 0;
            right: 100vw;
            width: 100%;
            transition: .3s all;
        }
    </style>
